import React from "react";
import { ConnectedRouter } from "connected-react-router";
import { Switch, Route } from "react-router-dom";
import LoginPage from "../LoginPage";
import CriarViagem from "../CriarViagem";




const routes = {
  root: "/",
  criarviagem: "trips/create",

  // Outras rotas aqui
}

function Router(props) {
  return (
    <ConnectedRouter history={props.history}>
      <Switch>
        <Route path={routes.root} component={LoginPage} exact />
        <Route path={routes.criarviagem} component={CriarViagem} />
        <Route path={routes.listarviagem} component={ListarViagem} />
      </Switch>
    </ConnectedRouter>
  );
}

export default Router;
